import { motion } from "framer-motion";
import styled from "styled-components";

const HomeComponentStyle = styled(motion.div)`
  position: relative;
  left: 5vw;
  margin-top: 100px;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  height: auto;
  width: 90vw;
  font-size: 16px;
  .introBg {
    position: relative;
    margin-top: 100px;
    background-image: url("https://images.pexels.com/photos/3304170/pexels-photo-3304170.jpeg?auto=compress&cs=tinysrgb&dpr=2&h=650&w=940");
    background-position: 0 -1000px;
    background-repeat: no-repeat;
    background-size: cover;
    background-clip: border-box;
    width: 90vw;
    height: 600px;
  }
  .aboutUs {
    height: 100px;
    width: 300px;
    position: absolute;
    right: 10%;
    margin-top: 500px;
    display: flex;
    flex-direction: column;
    justify-content: space-between;
    color: #c1c0c4;
  }
  .intro {
    display: flex;
    flex-direction: column;
    height: 600px;
  }
  .logo {
    margin-top: 30px;
    font-size: 150px;
    margin-bottom: 30px;
    color: #f8f8ff;
  }
  .welcome,
  .text {
    color: #c1c0c4;
    width: 300px;
  }
  .text {
    width: 500px;
  }
  .styles {
    display: flex;
  }
  .bigLogo {
    display: flex;
    justify-content: space-between;
    align-items: baseline;
  }
`;

const HomeComponent3 = () => {
  return (
    <HomeComponentStyle>
      <div className="intro">
        <div className="styled">
          <span className="welcome"> welcome to </span>
          <div className="bigLogo">
            <span className="logo"> deepend </span>
            <span className="text">
              “We Become What We Think About.” <br /> -Earl Nightingale
            </span>
          </div>
        </div>
        <div className="aboutUs">
          <span> we gave our visitor what they exactly want to read </span>
          <span>
            simple title with deep content could make them read the articles
            three times or more
          </span>
          <span>
            many articles type because of the good trafic we have and our newest
            authors ebery day
          </span>
        </div>
      </div>
      <div className="introBg" />
    </HomeComponentStyle>
  );
};
export default HomeComponent3;
